def longest_slide_down(pyramid):
    for layer in range(len(pyramid)-2,-1,-1):
        for num in range(len(pyramid[layer])):
            pyramid[layer][num] = pyramid[layer][num] + pyramid[layer+1][num] if pyramid[layer+1][num] > pyramid[layer+1][num+1] else pyramid[layer][num] + pyramid[layer+1][num+1]
    return pyramid[0][0]

